              target="_blank"
              rel="noopener noreferrer"
              >
            </Nav.Link>
          </Tab>

          <Tab eventKey="resume" title="Resume">
            <Nav.Link 
              href= {Resume}
              target="_blank"
              rel="noopener noreferrer"
              > well
            </Nav.Link>
          </Tab>

          <Tab eventKey="marmosets" title="Marmosets" onSelect={()=> window.open("google.com","_blank")}>

          </Tab>

        </Tabs>
      </Nav>

    );
